const contentData = [
  {
    title: "Here is G's GitHub repo",
    link: "https://auth0.com/docs/connections",
    description:
      "G started her coding journey in March 2021, take a look at what mischief or goodness she's been up to since.  You might find something you like, though mostly it's just a collection of digital keepsakes."
  },
  {
    title: "G's passion project: Sustainable Oceans",
    link: "https://yumseafood.shop/",
    description:
      "Let's face it the world is in pretty bad shape.  We need to change our ways to make it through.  Our oceans are processing 70% of our fossil fuel carbons.  Let's use your wallet to make sure our Ocean eco-systems are preserved.  This site is mainly in Chinese though. "
  },
  {
    title: "Anomaly Detection",
    link: "https://auth0.com/docs/anomaly-detection",
    description:
      "Auth0 can detect anomalies and stop malicious attempts to access your application. Anomaly detection can alert you and your users of suspicious activity, as well as block further login attempts."
  },
  {
    title: "Learn About Rules",
    link: "https://auth0.com/docs/rules",
    description:
      "Rules are JavaScript functions that execute when a user authenticates to your application. They run once the authentication process is complete, and you can use them to customize and extend Auth0's capabilities."
  }
];

export default contentData;
